import React from "react";

function NavBar() {
  return (
    <nav className="navbar flex-row">
      <ul className="admissions flex-grow">ADMISSIONS</ul>
      <ul className="academics flex-grow">ACADEMICS</ul>
      <ul className="career flex-grow">CAREER DEVELOPMENT CENTER</ul>
      <ul className="facilities flex-grow">FACILITIES</ul>
      <ul className="campusLife flex-grow">CAMPUS LIFE</ul>
      <ul className="research flex-grow">RESEARCH</ul>
      <ul className="about flex-grow">ABOUT</ul>
      <ul className="campuses flex-grow">VIT CAMPUSES</ul>
    </nav>
  );
}

export default NavBar;
